#include <stdio.h>
#include <string.h>

int main() {
	char text[21], *result;
	char *message = "";
	int position;

	scanf("%s", text);
	result = strstr(message, text);
	position = result - message;

	if (position >= 0) {
		printf("Exist [%d]", position);
	}
	else {
		printf("Not Exist");
	}
	return 0;
}
